  //---------------------------------End ST7735S Power Sequence-------------------------------------// 
  LCD_Write_Reg(0xC5); //VCOM 
  LCD_Write_Data_8Bit(0x1A); 
  LCD_Set_Rotation();
  //------------------------------------ST7735S Gamma Sequence---------------------------------// 
  LCD_Write_Reg(0xE0); 
  LCD_Write_Data_8Bit(0x04); 
