  LCD_Write_Data_8Bit(0x2E); 
  LCD_Write_Data_8Bit(0x3A); 
  LCD_Write_Data_8Bit(0x00); 
  LCD_Write_Data_8Bit(0x01); 
  LCD_Write_Data_8Bit(0x03); 
  LCD_Write_Data_8Bit(0x13); 
  LCD_Write_Reg(0xE1); 
  LCD_Write_Data_8Bit(0x04); 
  LCD_Write_Data_8Bit(0x16); 
  LCD_Write_Data_8Bit(0x06); 
  LCD_Write_Data_8Bit(0x0D); 
  LCD_Write_Data_8Bit(0x2D); 
  LCD_Write_Data_8Bit(0x26); 
  LCD_Write_Data_8Bit(0x23); 
  LCD_Write_Data_8Bit(0x27); 
