void LCD_Fill(uint16_t x_start,uint16_t y_start,uint16_t x_end,uint16_t y_end,uint16_t color)
{          
  uint16_t i = 0,j = 0; 
  LCD_Set_Address(x_start,y_start,x_end-1,y_end-1);
  for(i=y_start;i<y_end;i++)
  {													   	 	
    for(j=x_start;j<x_end;j++)
    {
      LCD_Write_Data_16Bit(color);
    }
  }
}

void LCD_Draw_Point(uint16_t x,uint16_t y,uint16_t color)
{
  LCD_Set_Address(x,y,x,y);
  LCD_Write_Data_16Bit(color);
}

void LCD_Draw_Line(uint16_t x_start,uint16_t y_start,uint16_t x_end,uint16_t y_end,uint16_t color)
{
  uint16_t t = 0; 
  uint32_t xerr = 0,yerr = 0,delta_x = 0,delta_y = 0,distance = 0;
  uint32_t incx = 0,incy = 0,uRow = 0,uCol = 0;
  delta_x=x_end-x_start;
  delta_y=y_end-y_start;
  uRow=x_start;
  uCol=y_start;
  if(delta_x>0)incx=1;
  else if (delta_x==0)incx=0;
  else {incx=-1;delta_x=-delta_x;}
  if(delta_y>0)incy=1;
  else if (delta_y==0)incy=0; 
  else {incy=-1;delta_y=-delta_y;}
  if(delta_x>delta_y)distance=delta_x;
  else distance=delta_y;
  for(t=0;t<distance+1;t++)
  {
    LCD_Draw_Point(uRow,uCol,color);
    xerr+=delta_x;
    yerr+=delta_y;
    if(xerr>distance)
    {
      xerr-=distance;
      uRow+=incx;
    }
    if(yerr>distance)
    {
      yerr-=distance;
      uCol+=incy;
    }
  }
}

void LCD_Draw_Rectangle(uint16_t x_start, uint16_t y_start, uint16_t x_end, uint16_t y_end,uint16_t color)
{
  LCD_Draw_Line(x_start,y_start,x_end,y_start,color);
  LCD_Draw_Line(x_start,y_start,x_start,y_end,color);
  LCD_Draw_Line(x_start,y_end,x_end,y_end,color);
  LCD_Draw_Line(x_end,y_start,x_end,y_end,color);
}

void LCD_Draw_Circle(uint16_t x,uint16_t y,uint8_t r,uint16_t color)
{
  uint32_t a,b;
  a=0;b=r;	  
  while(a<=b)
  {
    LCD_Draw_Point(x-b,y-a,color);             //3           
    LCD_Draw_Point(x+b,y-a,color);             //0           
    LCD_Draw_Point(x-a,y+b,color);             //1                
    LCD_Draw_Point(x-a,y-b,color);             //2             
    LCD_Draw_Point(x+b,y+a,color);             //4               
    LCD_Draw_Point(x+a,y-b,color);             //5
    LCD_Draw_Point(x+a,y+b,color);             //6 
    LCD_Draw_Point(x-b,y+a,color);             //7
    a++;
    if((a*a+b*b)>(r*r))
    {
      b--;
    }
  }
}

void LCD_Show_Char(uint16_t x,uint16_t y,uint8_t num,uint16_t font_color,uint16_t background_color,uint8_t font_size,uint8_t mode)
{
  uint8_t temp = 0,sizex = 0,t = 0,m = 0;
  uint16_t i = 0,TypefaceNum = 0;
  uint16_t x0 = x;
  sizex=font_size/2;
  TypefaceNum=(sizex/8+((sizex%8)?1:0))*font_size;
  num=num-' ';
  LCD_Set_Address(x,y,x+sizex-1,y+font_size-1);
  for(i=0;i<TypefaceNum;i++)
  { 
    if(font_size==12)temp=ASCII_1206[num][i];
    else if(font_size==16)temp=ASCII_1608[num][i];
    else if(font_size==24)temp=ASCII_2412[num][i];
    else if(font_size==32)temp=ASCII_3216[num][i];
    else return;
    for(t=0;t<8;t++)
    {
      if(!mode)
      {
        if(temp&(0x01<<t))LCD_Write_Data_16Bit(font_color);
        else LCD_Write_Data_16Bit(background_color);
        m++;
        if(m%sizex==0)
        {
          m=0;
          break;
        }
      }
      else
      {
        if(temp&(0x01<<t))LCD_Draw_Point(x,y,font_color);
        x++;
        if((x-x0)==sizex)
        {
          x=x0;
          y++;
          break;
        }
      }
    }
  }   	 	  
}

void LCD_Show_String(uint16_t x,uint16_t y,const uint8_t *p,uint16_t font_color,uint16_t background_color,uint8_t font_size,uint8_t mode)
{         
  while(*p!='\0')
  {       
    LCD_Show_Char(x,y,*p,font_color,background_color,font_size,mode);
    x+=font_size/2;
    p++;
  }  
}

uint32_t mypow(uint8_t m,uint8_t n)
{
  uint32_t result=1;	 
  while(n--)result*=m;
  return result;
}

void LCD_Show_Int_Num(uint16_t x,uint16_t y,uint16_t num,uint8_t length,uint16_t font_color,uint16_t background_color,uint8_t font_size)
{         	
  uint8_t t = 0,temp = 0;
  uint8_t enshow = 0;
  uint8_t sizex=font_size/2;
  for(t=0;t<length;t++)
  {
    temp=(num/mypow(10,length-t-1))%10;
    if(enshow==0&&t<(length-1))
    {
      if(temp==0)
      {
        LCD_Show_Char(x+t*sizex,y,' ',font_color,background_color,font_size,0);
        continue;
      }else enshow=1; 
      
    }
    LCD_Show_Char(x+t*sizex,y,temp+48,font_color,background_color,font_size,0);
  }
} 

void LCD_Show_Float_Num(uint16_t x,uint16_t y,float num,uint8_t length,uint16_t font_color,uint16_t background_color,uint8_t font_size)
{         	
  uint8_t t = 0,temp = 0,sizex = 0;
  uint16_t num_temp = 0;
  sizex=font_size/2;
  num_temp=(uint16_t)(num*100);
  for(t=0;t<length;t++)
  {
    temp=(num_temp/mypow(10,length-t-1))%10;
    if(t==(length-2))
    {
      LCD_Show_Char(x+(length-2)*sizex,y,'.',font_color,background_color,font_size,0);
      t++;
      length+=1;
    }
    LCD_Show_Char(x+t*sizex,y,temp+48,font_color,background_color,font_size,0);
  }
}
